import React from "react";
import "./App.css";
//import TodoForm from "./components/TodoForm";
import TodoList from "./components/TodoList";

function App() {
  return (
    <div className="a">
      {/* <TodoList /> */}
      <div style="display: flex; flex-direction: row-reverse; align-items: center; gap: 12px; background: dodgerblue; padding: 12px;">
        <button style="margin-right: auto">Button</button>
        <code style="color: #fff">Title</code>
        <button></button>
      </div>
    </div>
  );
}

export default App;
